import './App.css';
import Header from './components/Header';
import { Routes, Route, Link } from 'react-router-dom';
import Login from './pages/login.page';

function App() {
  return (
    <div className="App">
      <Header />
      <Routes>
        <Route path='/login' element={<Login />} />
        <Route></Route>
      </Routes>
    </div>
  );
}

export default App;
